import React from 'react';

import { getUser } from './utils/Common';

function Home() {
    const user = getUser();
  
    return (
        <div class="container">
            <main role="main" class="pb-3">
                <div class="text-center">
                    <h1 class="display-4">{user ? 'Welcome, ' + user.firstname : 'Welcome'}</h1>
                </div>
            </main>
        </div>
    );
}

export default Home;
